F = {

    webviewIsLoading: false,
    DB: [],

    START() {
        say.m('F.START()')
        F.GET_DB()
        F.UPDATE()
        F.EVENT()
    }, EVENT() {
        eventEmitter.on('startLoadingPage', () => {

            rerenderTabstrip()
            F.UPDATE()
        })
        eventEmitter.on('stopLoadingPage', () => {

            rerenderTabstrip()
            F.UPDATE()
            setTimeout(function () {
                F.UPDATE()
            }, 1500)
            setTimeout(function () {
                F.UPDATE()
            }, 2500)
        })
        eventEmitter.on('goToCollection', () => {
            F.UPDATE()
        });
        eventEmitter.on('updatePage', () => {
            F.UPDATE()
            setTimeout(function () {
                F.UPDATE()
            }, 1500)
            setTimeout(function () {
                F.UPDATE()
            }, 2500)
        });
        eventEmitter.on('updateFavicon', () => {
            F.UPDATE()
            setTimeout(function () {
                F.UPDATE()
            }, 1500)
            setTimeout(function () {
                F.UPDATE()
            }, 2500)
        });
        eventEmitter.on('renderOverlay', () => {
            F.UPDATE()
        });
        eventEmitter.on('addTab', () => {
            F.UPDATE()
        });
        eventEmitter.on('windowClose', () => {
            F.SET_DB()
        });
    }, GET_DB() {
        say.m('F.GET_DB()')
        fDB.favicons.toArray(function (e) {
            F.DB = e
        })
        fDB.favicons.clear()
    }, SET_DB() {
        say.m('F.SET_DB()')
        fDB.favicons.bulkAdd(F.DB)
    },

    UPDATE() {
        say.m('F.UPDATE()')

        if (F.DB.length == 0)
            F.___SET_TEST_DATA()

        // get data
        let collectionNowId = tabState.selectedTask
        let collectionNowIndex = ''
        let collectionNowTabs = ''
        let collectionNowTabIdSelected = ''

        for (let i = 0; i < tabState.tasks.length; i++) {
            if (collectionNowId == tabState.tasks[i].id) {
                collectionNowIndex = i
                collectionNowTabs = tabState.tasks[i].tabs
            }
        }

        // set
        for (let s = 0; s < collectionNowTabs.length; s++) {
            let hostTab = F._urlToHost(collectionNowTabs[s].url)
            if (hostTab != '') {
                try {
                    for (let j = 0; j <= F.DB.length; j++) {
                        if (F.DB[j].url == hostTab) {
                            document.querySelectorAll('.tab-item img')[s].src = F.DB[j].base64
                        }
                    }
                } catch (e) {
                }
            }


            // let collectionUrl = ('file:///' + path.join(__dirname) + '/pages/collection/index.html').replace(/\\/g, "/")
            // if (collectionNowTabs[s].url == collectionUrl) {
            //     try {
            //         for (let j = 0; j < F.DB.length; j++) {
            //             if (F.DB[j].url == 'collection') {
            //                 document.querySelectorAll('.tab-item img')[s].src = F.DB[j].base64
            //             }
            //         }
            //     } catch (e) {
            //     }
            // }
            let settingsUrl = ('file:///' + path.join(__dirname) + '/pages/settings/index.html').replace(/\\/g, "/")
            if (collectionNowTabs[s].url == settingsUrl) {
                try {
                    for (let j = 0; j < F.DB.length; j++) {
                        if (F.DB[j].url == 'sttings') {
                            document.querySelectorAll('.tab-item img')[s].src = F.DB[j].base64
                        }
                    }
                } catch (e) {
                }
            }

        }

        if (F.webviewIsLoading) {
            try {
                document.querySelector('.tab-item.active img.favicon').src = F.___LOADING_ICON()
            } catch (e){}

        }

    }, _urlToHost(url) {
        try {
            return new URL(url).host
        } catch (e) {
            return ''
        }
    }, _setCollectionFaviconOnId(id) {
console.log( '----', id )


    },

    ADD(url, faviconUrl) {
        say.m('F.ADD()')

        let urlHost = ''
        try {
            urlHost = new URL(url).host
        } catch (e) {
            urlHost = ''
        }

        if (urlHost != '') {
            let isIbDB = false
            for (let j = 0; j < F.DB.length; j++) {
                if (F.DB[j].url == urlHost) {
                    isIbDB = true
                }
            }
            if (!isIbDB) {
                request.get(faviconUrl, function (error, response, body) {

                    if (!error && response.statusCode == 200) {
                        data = 'data:' + response.headers['content-type'] + ';base64,' + new Buffer(body).toString('base64')

                        if (data.length > 1000)
                            F._pushFaviconToArr(data, urlHost)
                        else
                            F._pushFaviconToArr(F.___NO_FAVICON_ICON(), urlHost)

                    } else {
                        say.d('F.ADD() error: !error && response.statusCode == 200')

                    }
                    eventEmitter.emit('updateFavicon')

                })
            } else {
                say.d('F.ADD() error: !isIbDB')
            }
        } else {
            say.d('F.ADD() error: urlHost != \'\'')
        }

    }, _pushFaviconToArr(base64, url) {
        F.DB.push({
            'base64': base64,
            'url': url
        })
    },


    ___SET_TEST_DATA() {
        let url = 'github.com'
        let base64 = 'data:image/png;base64,'
        F.DB.push({'url': url, 'base64': base64})

        url = 'duckduckgo.com'
        base64 = 'data:image/ico;base64,'
        F.DB.push({'url': url, 'base64': base64})

        url = 'www.google.com.ua'
        base64 = 'data:image/ico;base64,'
        F.DB.push({'url': url, 'base64': base64})

        url = 'sttings'
        base64 = 'data:image/png;base64,'
        F.DB.push({'url': url, 'base64': base64})

        url = 'collection'
        base64 = 'data:image/png;base64,'
        F.DB.push({'url': url, 'base64': base64})
    },
    ___NO_FAVICON_ICON() {
        return 'data:image/png;base64,\n'
    },
    ___LOADING_ICON() {
        return 'data:image/gif;base64,'
    }
}
F.START()


document.querySelector('.active').classList.remove('selected')
document.querySelector('.active').classList.remove('active')